import React from 'react';
// import './tt'
netflixdata.map((value)=>{
    value.sname,
    value.lname,
    value.imgsrc,
    value.title
})
function Cards(props){
    return (
    <div className="card">
    <div>
        <img src = {props.value.imgsrc}/>
        </div>
        <div className="title">
        <h1>{props.value.title}</h1>
        </div>
        <div>
            <h2>{props.value.sname}</h2>
        </div>
        <div className = 'name'>
        <a href = {props.value.lname}><button>Start Now</button></a>
        </div>
    </div>

    );
};
export default Cards;
